import Cabecalho from '../../utils/cabecalho';
import { 
    Container,
    Row,
    Col,
} from 'react-bootstrap';

function Home() {
    return ( 
        <div>
            <Cabecalho />
            <Container fluid>
                <Row>
                    <Col md={2} bg="primary"
                        style={{ 
                            minHeight: '100%' }} >
                            1
                    </Col>
                    <Col md={10} bg="danger"
                        style={{ 
                            minHeight: '100%' }} >
                            2
                    </Col>
                </Row>
            </Container>
        </div> 
    );
}

export default Home;
